import '../CSScomponents/Title.css';

export default function Title() {

  return (
    <div className='Title'>
      <div>
        <h1>logo</h1>
      </div>
      <div>
        <input type="text" />
        <br />
        <input type="text" />
      </div>
    </div>
  );
}
